### Describe the issue

I run multiple threads on the same OrtSession object, invoking the run() method. My default configeration is sequential as below:
```
opts.setOptimizationLevel(OrtSession.SessionOptions.OptLevel.ALL_OPT);
opts.setExecutionMode(OrtSession.SessionOptions.ExecutionMode.SEQUENTIAL);
opts.setIntraOpNumThreads(1);
```
As the thread-num increased from 1 to 10, the CPU occupation is always 100% * thread-num, and the time it consumed doesn't not increase significantly (0.090 > 0.116 > 0.117).

![image](https://github.com/microsoft/onnxruntime/assets/30071492/e2faaed7-90fc-4fa4-899e-deaaae29e759)

It is an ideal multi-threading performance. More threads in the external pool will occupy larger CPU to keep the overall performance stable.

But when the thread-num is set to 15, the CPU occupation is much lower than 1500%(1105%), and the time for 15 threads to finish computing is 0.154（+30%）.

I have tried with opts.setIntraOpNumThreads(15), but the performance is even worse：CPU = 2700% and time = 0.182

How to achieve a constant processing speed per thread while increasing the overall throughput as the number of threads increases?

